43X)"]},{"cell_type":"markdown","id":"cedfe6cb","metadata":{"papermill":{"duration":0.009392,"end_time":"2023-11-24T14:37:06.312455","exception":false,"start_time":"2023-11-24T14:37:06.303063","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"de823ca5","metadata":{"papermill":{"duration":0.009464,"end_time":"2023-11-24T14:37:06.33218","exception":false,"start_time":"2023-11-24T14:37:06.322716","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"d2682a1e","metadata":{"execution":{"iopub.execute_input":"2023-11-24T14:37:06.355895Z","iopub.status.busy":"2023-11-24T14:37:06.353679Z","iopub.status.idle":"2023-11-24T14:37:06.430572Z","shell.execute_reply":"2023-11-24T14:37:06.428511Z"},"papermill":{"duration":0.091703,"end_time":"2023-11-24T14:37:06.433351","exception":false,"start_time":"2023-11-24T14:37:06.341648","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>a